Na aula eu pensei, faltar no treino pra estudar de sexta a domingo, intensivão

Que nada, no grupo galera fazendo lista de quem vai, putz, e ai que começa

No treino que eu precisava faltar, todo mundo vai, porra, vou ficar quieto aqui pra esquecerem de mim

Logo aparece notificação do coach perguntando se eu vou ?! não teve jeito eu fui

Fui pensando em chegar cedo pra sair na metade do treino. Cheguei cedo! chegando lá só tava o coach arrumando o som. Ja fiquei puto kk 

Fui alongando, geral chegando, eu com cara de cu querendo matar cada um que chega atrasado

Treino começou, comecei a contar os atletas pra ve se faltava alguém, imagina!? Sim, faltavam 2! Porra já fiquei mais puto, na lista tava geral confirmando! 

Não tinha o que fazer... já tava ali... planejei já... vou virar a noite hoje estudando pra prova” kkk

Treinin rolando, olhei pro relógio metade do treino já foi, (tinha esquecido que eu prometi pra mim mesmo que ia embora no meio)

Não tem jeito, metade do treino começa os stunts, a parte que eu mais gosto... já foi.. vou morrer treinando...começo treinar sorrindo, rindo extremamente satisfeito...

Não adianta é a partir dai que eu me entrego... só quero saber do cheer, 

repetir repetir repetir... não dá nem raiva de quem ta errando e isso nem importa mais, todo mundo rindo... feliz... coach puto por fora mas feliz por dentro

Final do treino... já nem lembro da prova. . .  já até confirmo minha presença no treino extra de domingo... 

É isso... não tem jeito... cada coisa ruim que acontece antes do treino...mas durante o treino tudo muda...o cheer muda a gente no dia a dia, treino a treino...

Sextou é isso! Ta liberado beber em casa!

